INSERT INTO `subtasks` (`id`, `task_id`, `order`, `question`, `options`, `type`, `marks`) VALUES
(1, 1, 0, '<p>A) „Hír érkezett […] e hónap 18-án. Ez is megerősítette az újságot, annak hozzáadásával, hogy Lisszabonba [Portugália] öt karavella [hajótípus] érkezett Kálikutból [India] árukkal megrakva.” <em>(Girolamo Priuli velencei politikus naplójából, 1506)</em></p><p><br></p><p>B) „A lengyel királyságnak és az említett Danzig [Gdańsk] városának egész gazdagsága és jövedelme abból származik, hogy a hollandok minden évben egyszer vagy kétszer két-háromszáz hajóval eljönnek Danzigba, s két hét leforgása alatt felvásárolják és elszállítják az összes gabonát, amit az említett városban találnak.” <em>(Transylvanus császári küldött jelentése, 1546) </em></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p><strong>a) Állapítsa meg, melyik kereskedelmi útvonalakról szól a két forrás! Írja a térképen látható sorszámot a forrás betűjeléhez!</strong></p><p><br></p><p><strong>A forrás:</strong></p>', '[\"1\", \"2\"]', 'multiple_choice', 0.50);
INSERT INTO `subtasks` (`id`, `task_id`, `order`, `question`, `options`, `type`, `marks`) VALUES
(2, 1, 1, '<p><strong>B forrás:</strong></p>', '[\"1\", \"2\"]', 'multiple_choice', 0.50),
(3, 1, 2, '<p><strong>c) Az A) betűjelű forrásban leírt jelenség hatására Velence hanyatlásnak indult. Magyarázza meg ennek okát!</strong></p>', '[\"Spanyolország\", \"Portugália\"]', 'short_answer', 1.00),
(4, 1, 3, '<p><strong>d) Mi az oka a B) forrásban leírt jelenségnek? Jelölje be az egyetlen helyes választ!</strong></p>', '[\"A hollandok nem tudtak bekapcsolódni a gyarmatosításba, ezért így jutottak gabonához\", \"Németalföld Spanyolországhoz tartozott, így a spanyolok felvásárolták a holland gabonát\", \"A gyorsan növekvő városi lakosságot így tudták ellátni élelmiszerrel\"]', 'multiple_choice', 0.50),
(5, 1, 4, '<p><strong>e) Milyen gazdasági következményekkel járt a B) betűjelű forrásban leírt tevékenység? Jelölje be az egyetlen helyes választ!</strong></p>', '[\"A kereskedelemből származó bevételekből manufaktúrákat alapítottak Lengyelországban.\", \"A lengyel jobbágyok robotterhei növekedtek.\", \"A megerősödő lengyel városokra támaszkodva a királyi hatalom háttérbe szorította a nemességet.\"]', 'multiple_choice', 0.50),
(6, 1, 5, '<p><strong>f) A hollandok a B) betűjelű forrás keletkezésének idején a Spanyol Királyság alattvalói voltak. Magyarázza meg, milyen gazdasági előnyt jelentett ez a hollandok számára!</strong></p>', NULL, 'short_answer', 1.00);
INSERT INTO `subtasks` (`id`, `task_id`, `order`, `question`, `options`, `type`, `marks`) VALUES
(7, 2, 0, '<p><strong>Mutassa be a források és ismeretei segítségével Németország területi változásait és azok okait a Német Császárság születésétől a kétpólusú világ felbomlásáig a megadott szempontok szerint:</strong></p><ul><li><strong>a Német Császárság létrejötte,</strong></li><li><strong>a versailles-i béke,</strong></li><li><strong>a náci Németország terjeszkedése,</strong></li><li><strong>Molotov–Ribbentrop-paktum,</strong></li><li><strong>Hitler birodalma a második világháború alatt,</strong></li><li><strong>Németország helyzete a második világháború után,</strong></li><li><strong>a német újraegyesítés!</strong></li></ul><p><em>A hadi eseményekről nem kell írnia! Használja a középiskolai történelmi atlaszt!</em></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><em>Az utolsó érintés. A Punch Magazin karikatúrája, 1919 (A karikatúra angol nyelvű feliratai magyarul: a kézre írva: szövetségesek; a bajszos férfira írva: Németország; a férfialak alatti pallóra írva: béketárgyalások.)</em></p><p><br></p><p>„A lengyel államhoz tartozó területek területi-politikai átformálása esetén Németország és a Szovjetunió érdekszféráját hozzávetőleg a Narev, a Visztula és a Szan folyók vonala határolja el. Azt a kérdést, hogy a kétoldalú érdekek kívánatosnak tüntetik-e fel egy független lengyel állam fenntartását, és melyek lennének ezen állam határai, végleg csak további politikai fejlemények során lehet tisztázni. A két kormány ezt a kérdést mindenesetre barátságos megegyezés útján fogja megoldani.” <em>(Molotov–Ribbentrop-paktum)</em></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><em>Németország 1942-ben</em></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><em>Németország területének változásai, 1947</em></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><em>Berlin, 1989 ősze</em></p>', NULL, 'essay', 22.00);

